import React from 'react';
import Layout from "./Layouts/Layout";

class Compositions extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            title: 'Compositions',
        }
    }

    render() {
        return (
            <Layout title={this.state.title}>
                <div>
                    <h1>Compositions</h1>
                </div>
            </Layout>
        );
    }
}

export default Compositions
